import './PlayOptions.css'
import {
    BrowserRouter,
    Routes,
    Route,
  } from "react-router-dom";

function PlayOptions() {
    return (

        <BrowserRouter className="PlayOptions">
            <Routes>
                <Route className='PlayOption' path="/" element={<App />}>flip</Route>
                <Route className='PlayOption' path="expenses" element={<Expenses />}>create private room</Route>
                <Route className='PlayOption' path="invoices" element={<Invoices />}>join private room</Route>
            </Routes>
    </BrowserRouter>
    );
};

export default PlayOptions;
